import React, { Component } from 'react';
import SearchUser  from './SearchUser';
import User  from './User';
import axios from 'axios';

export class Users extends Component {

    constructor(props) {
        super(props)

        this.state = {
            users: []
        }    
    }

    getUsers = () => {
        axios.get('http://api.github.com/users')
        .then(Response => {
            this.setState({
                users: Response.data
            })
        })
    }

    componentDidMount() {
        this.getUsers();
            }

