    render() {
        return (
            <div>
           <div className="row my-2">
               <div className="col-md-12">
                    <SearchUser />
               </div>
           </div>
            <div className="row">
                {this.state.users.map(user => (
                   <div className="col-md-4">
                   <User user={user} getUserSearch="" />
                   </div>
                   
                ))}
        
            </div>
            </div>
                )
    }
}

export default Users
